Tilted Bowl - The one and only, available one night only! 
@fruitsupershop - Seattle, WA! 
March 9th, 5-8pm.

Next Saturday in Long Beach! You know how people get really into stuff? Stuff like cigars and whiskey, or brewing beer, or yoga, or climbing rocks, or prebiotic beverages, or pizza making? And then those people channel that interest through a venture, like starting a club, or a business, or going on a trip to Nicaragua and bringing film equipment with them? You know, doing a thing that no one asked you to do, but you just do it, because you move through the world in a way where you process and reprocess your experiences by putting together a short film and sharing it with people? Yes? Maybe? That’s the good stuff. This is the good stuff. Cheers to friends who are generous enough to make things that no one asked or paid them to make - that’s art. Should be a fun night! Cruise out. Meet some people. 
